INSERT INTO `frequest_questions` VALUES (1,'Que_1001','Is there a mandate to complete a certain average number of hours in a month?','Employees have to maintain an average of 9 hours per day in a salary cycle period.',167,1,'2017-09-22 12:04:50','2017-09-22 12:46:49'),(2,'Que_1002','What are the total number of hours that I need to work to be marked present for a full day?','A working day is considered a full day if an employee works for more than 7 hours',NULL,1,'2017-09-22 12:04:50','2017-09-22 12:04:50'),(3,'Que_1003','Are there any minimum number of hours I need to complete to be marked present for half a day?','To avail a half-day leave, the employee is required to work for a minimum period of 4.5 hours and should intimate the immediate supervisor or the skip-level manager',NULL,1,'2017-09-22 12:04:50','2017-09-22 12:04:50'),(4,'Que_1004','What are the types of leaves (leave ledgers) I am eligible to get?','SGA follows the All planned leave system. which inclusive of Planed Leave, Sick Leave, casual leaves and approved process off.',NULL,1,'2017-09-22 12:04:50','2017-09-22 12:04:50'),(5,'Que_1005','How do I change my password in HRMS','Passwords can be changed in the My Profile Page. My Profile page is located by navigating the following path: \nHome > People Tools > Maintain Security > Use > My Profile.\nWhen you are in the My Profile page, you will see an option to change your password which reads as, \"Change password\". Click on this link. Type the old password and the new password. Make a note of the new password. Then, click on save, to save the password. If your save is successful, you will be brought back to the General Profile Information screen. Your new password is now in effect.',NULL,1,'2017-09-22 12:04:50','2017-09-22 12:04:50'),(6,'Que_1006','My wife gave birth to our first child on 8-8-2004. I applied for Paternity Leave from 4-2-2005 to 18-2-2005. But our Administration denied the leave for 15 days saying that under the existing rule, we have to exhaust the Paternity Leave within six month from the date of delivery. Since the date of delivery is 8-8-2004, the six months period expires on 7-2-2005 as such the Paternity Leave can be sanctioned from 4-2-2005 to 7-2-2005.\n\nPlease state whether the action taken by the Administration is in order.','Paternity Leave has to be availed within six months from the date of delivery of the child and there is no provision that it should be exhausted within that period. Hence, the contention of your office is not correct.',NULL,1,'2017-09-22 12:04:50','2017-09-22 12:04:50'),(7,'Que_1007','It is necessary as per rules for a female. employee to produce Medical Certificate before proceeding on Maternity Leave? Few instances have been noticed where Maternity Leave has been denied for want of Maternity Leave while commuted leave without Medical Certificate in continuation of Maternity Leave has been sanctioned. While no such demand was made for my first maternity leave by my parent department, the present office demands it. Kindly clarify.','Production of Medical Certificate is not necessary for availing Maternity Leave',NULL,1,'2017-09-22 12:04:50','2017-09-22 12:04:50'),(8,'Que_1008',' I had to undergo an miscarriage abortion in November, 1999 and applied 7 days leave out of 45 days admissible to me. Again I had to undergo another abortion in August, 2002 and applied for 21 days leave out of the remaining 38 days leave admissible to me. However, the same was not sanctioned on the grounds that maternity leave on account of miscarriage/abortion can be availed only once in the entire service period. Kindly clarify','the total period of maternity leave on account of miscarriage/abortion should be restricted to six weeks in the entire career of a female servant and it need not be in one occasion only',NULL,1,'2017-09-22 12:04:50','2017-09-22 12:04:50'),(9,'Que_1009','Maternity leave is admissible to a female employee if she has less than two surviving children. Please clarify whether a female employee who has been granted leave on two occasions earlier could be granted this leave again in case of death of first/second child.','Maternity leave is admissible if the female employee has “less than two surviving children”. There is no restriction as to the number of times the maternity leave could be availed. Hence, maternity leave is allowed in all cases where the female employees have no living children or only one living child.',NULL,1,'2017-09-22 12:04:50','2017-09-22 12:04:50'),(10,'Que_1010','What is the payroll cycle that is followed at SGA?','24th of a month to 23rd of the next month (Eg:- 24-Aug-2017 to 23-Sep-2017 for the month of September)',NULL,1,'2017-09-22 12:04:50','2017-09-22 12:04:50'),(11,'Que_1011','How does my leave get credited to my leave balance account','An employee will accrue 1.75 days of PL for every completed month, i.e., 23rd of a month (last day of salary cycle for a particular month). It would be calculated on a pro-data basis. Kindly refer the leave policy for more details',NULL,1,'2017-09-22 12:04:50','2017-09-22 12:04:50'),(12,'Que_1012','Can I take leave during my probation period?','SGA discourages employees from taking leaves during the first three months after joining. If an employee has to take a leave during this period, it will be treated as Leave Without Pay. However, this is treated on a case-by-case basis.',NULL,1,'2017-09-22 12:04:50','2017-09-22 12:04:50'),(13,'Que_1013','At the end of the year, how many leaves get carried to the next year?','For the subsequent calendar year, an employee is allowed to carry forward only 12 days of leave per year',NULL,1,'2017-09-22 12:04:50','2017-09-22 12:04:50'),(14,'Que_1014','My manager has asked me to work on my week-off due to business reasons. How do I apply for a comp. off.?','Employees required to work on a weekend are eligible for a Comp off in lieu of working on this day, provided it is initiated and approved by Business Unit Head / Division Head and the employee is not a senior manager or above',NULL,1,'2017-09-22 12:04:50','2017-09-22 12:04:50'),(15,'Que_1015','What are the minimum working hours to avail a comp. off.?','A working day is considered a eligible for a comp. off. if an employee works for more than 7 hours',NULL,1,'2017-09-22 12:04:50','2017-09-22 12:04:50'),(16,'Que_1016','What is the sandwich rule that I heard about from my colleagues?','Any unplanned leave or Leave Without Pay on a Friday and a Monday will lead to loss of pay for four days instead of two days.',NULL,1,'2017-09-22 12:04:50','2017-09-22 12:04:50'),(17,'Que_1017','I am using the HRMS portal for the first time. How do I apply for a leave?','You can login to the system and access the portal user manual for detailed guide',NULL,1,'2017-09-22 12:04:50','2017-09-22 12:04:50'),(18,'Que_1018','What is the procedure for reimbursement of expenses other than salary','Fill up the reimbursement form and attach all the necessary documents and supportings, and get the approval of relevant heads and submit the same to Finance Team. The Reimbursement form is available under Templates tab on SGAeasy portal',NULL,1,'2017-09-22 12:04:50','2017-09-22 12:04:50'),(19,'Que_1019','When do I get the expense reimbursement amount in my account','All the duly approved payments received till Tuesday of a week are processed on Thursday and credited to the bank accounts of the employees on Friday',NULL,1,'2017-09-22 12:04:50','2017-09-22 12:04:50'),(20,'Que_1020','How can one make a claim against L&D Policy','Fill up the form along with all necessary documents and supportings, and get the approval of relevant heads and submit the same to Finance Team',NULL,1,'2017-09-22 12:04:50','2017-09-22 12:04:50'),(21,'Que_1021','What is the difference between Salary and CTC','Any cost born by the employer on behalf of the employee like employer contribution to Provident Fund, Gratuity expense, Insurance expenses etc. over and above the employee\'s salary form part of the total CTC of the employee.',NULL,1,'2017-09-22 12:04:50','2017-09-22 12:04:50'),(22,'Que_1022','What would be the tax impact if I opt for reimbursements','The tax calculations depend on the amount of reimbursements opted by an employee. Higher the reimbursements opted and claims submitted, lower are the taxes. The taxes are calculated on the balance Net taxable Income based on the regular Tax slabs as defined under the Income Tax Act, 1961',NULL,1,'2017-09-22 12:04:50','2017-09-22 12:04:50'),(23,'Que_1023','How to check my PF balance / passbook','To view provident fund passbook, one may access it here . (https://passbook.epfindia.gov.in/MemberPassBook/Login.jsp) with one\'s UAN and password. ',NULL,1,'2017-09-22 12:04:50','2017-09-22 12:04:50'),(24,'Que_1024','How to link my Aadhar Card with UAN','1- To link your Aadhaar in UAN database, you have to login at UAN member portal. You can login at UAN member portal after the UAN activation\n2- At the UAN portal dashboard menu, you would see a link to ‘Manage’. In the drop-down menu, select ‘KYC’.\n3- You would see a form to update KYC documents. You can update or submit any of the document through this form. Now enter the document number and name as per the document. \n4- After the submission of details, your given information is sent to the employer. After the approval by the employer the new KYC document or Aadhaar is added in UAN database.',NULL,1,'2017-09-22 12:04:50','2017-09-22 12:04:50'),(25,'Que_1025','When do I get the amount uploaded in my Sodexo Card','The balance in Sodexo card is uploaded within 3 working days from the date of credit of the salary of the respective month.',NULL,1,'2017-09-22 12:04:50','2017-09-22 12:04:50'),(26,'Que_1026','How to claim salary reimbursements','Fill up the Top sheet form shared with you and fill in all the details of the expenses claimed to be reimbursed and attach all the bills and necessary details and deposit the form in the reimbursement box (generally kept in the Cafeteria area) between 17th to 23rd of a month. Additionally, also upload the details of the expenses claimed on the SGAeasy portal under the Reimbursements tab.',NULL,1,'2017-09-22 12:04:50','2017-09-22 12:04:50'),(27,'Que_1027','Can I submit salary related bills in advance for the complete year','Only the medical reimbursement bills submitted in advance are accepted for payments. However, any other reimbursement bills submitted in advance gets lapsed if the submission is over the eligibility amount',NULL,1,'2017-09-22 12:04:50','2017-09-22 12:04:50'),(28,'Que_1028','How do I know what is my carry forward amount','The carry forward balance is visible at the time of claiming reimbursements during last week of the month. The said balance cam also be self calculated and confirmed with the Finance team',NULL,1,'2017-09-22 12:04:50','2017-09-22 12:04:50'),(29,'Que_1029','What is the break up of my CTC','The detailed breakup (CTC wise) is forwarded to all the new joinees to enable them to opt of reimbursements. All the other details are generally shared by the HR team at the time of their joining.',NULL,1,'2017-09-22 12:04:50','2017-09-22 12:04:50'),(30,'Que_1030','Can I change my salary reimbursements after once I opt them','The salary reimbursements remain the same and can not be changed during the balance part of the Financial Year. The next changes happen only in the next Financial Year.',NULL,1,'2017-09-22 12:04:50','2017-09-22 12:04:50'),(31,'Que_1031','Can I change my eligible limit of salary reimbursements internally within other components. ','The reimbursement slabs eligibility has been mutually decided by the management of the company and the eligibility can not be changed by adjusting internally with other components.',NULL,1,'2017-09-22 12:04:50','2017-09-22 12:04:50'),(32,'Que_1032','What happens if I opt for reimbursements and do not submit the bills','In case the employee does not submit the bills even after opting for the reimbursements, then the said unclaimed balance gets withheld with the company and is carried forward to the next month. Then the unclaimed balance gets added to reimbursement eligibility of the next month and can be then claimed in the next month',NULL,1,'2017-09-22 12:04:50','2017-09-22 12:04:50');
